import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar = () => {
  return (
    <div>
      <h1>WILD CIRCUS BIARRITZ</h1>
      <NavLink to="/inscriptions">Inscriptions</NavLink>
      <NavLink to="/inscriptions">Our Team</NavLink>
    </div>
  );
};

export default Navbar;
